import React from "react";
import { Link } from "react-router-dom";
import './Settings.css';


const Settings = () => {


  return (
    <>
    <Link to="/">
        <div>Home</div>
      </Link>
      <Link to="/profile">
        <div>Profile</div>
      </Link>

      <Link to="/settings">
        <div>Settings</div>
      </Link>

    </>
  );
};

export default Settings;
